Here is a function to find the Eulerian number $ a(n, m) $ using a recursive formula:

```python
def eulerian(n, m):
    if m == 0:
        return 1
    if n == 0:
        return 0
    return (n - m) * eulerian(n - 1, m) + (m + 1) * eulerian(n - 1, m - 1)
```

The Eulerian number $ a(n, m) $ represents the number of permutations of $ n $ elements with exactly $ m $ ascents.

