def find_coefficients(a, b, n):
    def extended_gcd(a, b):
        if b == 0:
            return (a, 1, 0)
        else:
            g, x, y = extended_gcd(b, a % b)
            return (g, y, x - (a // b) * y)

    g, x, y = extended_gcd(a, b)
    if n % g != 0:
        return None

    x0 = (x * (n // g)) % (b // g)
    y0 = (y * (n // g)) % (a // g)

    return (x0, y0)
