Here is a function that finds the maximum sum of a bitonic subsequence in a given array:

```python
def max_bitonic_sum(arr):
    n = len(arr)
    if n == 0:
        return 0

    # Increasing sequence up to index i
    inc = [1] * n
    for i in range(1, n):
        for j in range(i):
            if arr[j] < arr[i]:
                inc[i] = max(inc[i], inc[j] + arr[i])

    # Decreasing sequence from index i
    dec = [1] * n
    for i in range(n-2, -1, -1):
        for j in range(i+1, n):
            if arr[j] < arr[i]:
                dec[i] = max(dec[i], dec[j] + arr[i])

    # Find the maximum sum of bitonic subsequence
    max_sum = 0
    for i in range(n):
        max_sum = max(max_sum, inc[i] + dec[i] - arr[i])

    return max_sum
```

