def nth_newman_shanks_williams_prime(n):
    def is_prime(num):
        if num < 2:
            return False
        for i in range(2, int(num**0.5) + 1):
            if num % i == 0:
                return False
        return True

    def generate_ws_primes():
        ws_primes = []
        k = 1
        while True:
            ws = (2 ** (k * 2 - 1)) - 1
            if is_prime(ws):
                ws_primes.append(ws)
            k += 1
            if len(ws_primes) == n:
                return ws_primes

    return generate_ws_primes()[n - 1]
```

