def max_sum(n, memo={}):
    if n == 0:
        return 0
    if n in memo:
        return memo[n]
    max_val = n
    for k in [2, 3, 4, 5]:
        current = max_sum(n // k, memo) + max_sum(n // k, memo)
        if current > max_val:
            max_val = current
    memo[n] = max_val
    return max_val
