Here is a function to find the maximum product formed by multiplying numbers of an increasing subsequence of an array:

```python
def max_product_increasing_subsequence(arr):
    n = len(arr)
    dp = [1] * n
    max_product = float('-inf')

    for i in range(n):
        for j in range(i):
            if arr[j] < arr[i]:
                dp[i] = max(dp[i], dp[j] * arr[i])
        max_product = max(max_product, dp[i])

    return max_product
```

