def task_func(df: pd.DataFrame, column_name: str, pattern: str) -> pd.DataFrame:
    if not pattern:
        return df.copy()

    def reverse_matching_words(text):
        words = text.split()
        matching = [word for word in words if re.fullmatch(pattern, word)]
        non_matching = [word for word in words if not re.fullmatch(pattern, word)]
        return ' '.join(non_matching + matching[::-1])

    df[column_name] = df[column_name].apply(reverse_matching_words)
    return df.copy()

